package com.thalhamer.numbersgame.domain;import java.util.List;/** * Created by Brian on 5/12/2015. */public class GameUnlock {    private Integer numOfStars;    private String sectionName;    private List<Power> powers;    public Integer getNumOfStars() {        return numOfStars;    }    public void setNumOfStars(Integer numOfStars) {        this.numOfStars = numOfStars;    }    public String getSectionName() {        return sectionName;    }    public void setSectionName(String sectionName) {        this.sectionName = sectionName;    }    public List<Power> getPowers() {        return powers;    }    public void setPowers(List<Power> powers) {        this.powers = powers;    }}